import React from 'react';
import Nav from '../../components/Nav/nav.js';

    //const fixedHeightPaper = clsx(classes.paper, classes.fixedHeight);
    class Blog extends React.Component {
      render() {
        return (
        <div className="App">
          <header className="App-header">
          </header>
          <body>
            <div id="menu">
              <Nav />
            </div>
            <div id="content">
            <img src="https://i.imgur.com/MA0jUB8.jpg" height="70px" />
            <p style="margin-bottom: 2em"> <b>Each post has less than 100 chars.</b></p>

            <div style="margin-bottom: 2em">
            <h3>Read the autobiography of Benjamin Franklin</h3> <p>It will help you to organize your life.</p>
            <p>January 3, 2020</p>
            </div>
            <div style="margin-bottom: 2em">
            <h3>Learn only what truly interests you.</h3> <p>It will help you avoid lying to yourself while learning.</p>
            <p>December 15, 2019</p>
            </div>
            <div style="margin-bottom: 2em">
            <h3>Germany doesn't have enough startups per capita.</h3> <p> It should stop taxing early-stage investors.</p>
            <p>December 9, 2019</p>
            </div>
           </div>
          </body>
      </div>
      );
        }
      }

export default Blog;
